    false,nt"url": null,nt"notes": "North-south flight paths of radio-tagged
    female northern pintails were monitored in a section of Highway 152 near Los Banos,
    California during 4 and 11 November and 9 December 1992 on their way from daytime
    roost sites in the north to nocturnal feeding sites in the south part of the Grassland
    Ecological Area. The dataset includes spatial and temporal information of 53 flight
    paths from 42 different pintails. Accuracy of individual data fields has been reviewed.
    Data collection is completed. References: Fleskes, J. P. 1999. Ecology of female
    northern pintails during winter in the San Joaquin Valley, California. Dissertation,
    Oregon State University, Corvallis, Oregon. Poster: http://www.werc.usgs.gov/dixon/pdfs/fleskes3940.jpg",nt"license_title":
